  input: TEXT,F3A,,"I received a notice about the amended 12-Day Pre-Primary Report.
    The reason for the sudden change is due to hiring a 3 party fund raising group
    called 'BMW Direct Inc.' They are located at 1155 15th Street NW, Suite 614, Washington,
    D.C. 20005. We were just signing up with them around the time the report was due.
    At the time of my initial reporting, we had not worked out all the arrangments
    by which they collect FEC data, and funds on the comittee's behalf, and then we
    would report together on the total money recieved. I was notified later on by
    one Scott McKenzie of BMW that if there was any questions or problems with the
    sudden change, to have whoever is concerned contact them and they will fully explain
    why the amendment had to be made. He can be reached at >> Scott B. Mackenzie,
    phone# 703-868-1776, fax# 320-215-9596, e-mail  mackenzie_co@yahoo.com  <<. You
    may also contact the owner, Kimberly Bellissimo at 202-457-1254 or  e-mail at
    kimberly@bmwdirectmail.com."
